import React from 'react';
import NavigationButton from './NavMenu';
import '../Styles/General.css';
import '../Styles/Home.css'; // Update the path to the CSS file

const Home = () => {
  return (
    <div>
      <h1 className="home-title">MUSEUM OF PHOTOGRAPHY</h1>
      <hr />
      <div>
        <h2>Exhibit name</h2>
        <p>Short description</p>
      </div>
      <img src="path_to_your_image" alt="Exhibit" />
      <div className="button-container">
        <button className="button standard">Button 1</button>
        <button className="button standard">Button 2</button>
      </div>
      <NavigationButton />
    </div>
  );
};

export default Home;
